import React from 'react'

const Add = () => {
  return (
    <div className='form'>
      <h1>ADD NEW SONG OR MUSIC</h1>
      <input type="text" placeholder='musicid' />
      <input type="text" placeholder='musicname' />
      <input type="text" placeholder='artist' />
      <input type="text" placeholder='picture' />
    </div>
  )
}

export default Add
